class Solution:
    def majorityElement(self, nums) -> int:
        greatest = -1
        seen = {
          -1: 0
        }
        
        for num in nums:
            if num in seen:
                seen[num] += num
            else:
                seen[num] = 1
            
            if seen[num] >= seen[greatest]:
                greatest = num
        
        return greatest


